import React from "react";
import NavigationBar from "./componments/NavigationBar";
import SvenskaCvPage from "./componments/SvenskaCvPage";

function App() {
  <Route exact path="/svensk" element={<SvenskaCvPage />} />;
  return <NavigationBar></NavigationBar>;
}

export default App;
